import React from 'react';
import {Panel, PanelHeader, Group, List, Cell } from '@vkontakte/vkui';

function ViewPanel ({...props}) {
  return (
    <Panel>
      <PanelHeader right={null}>Каталог</PanelHeader>
      <Group title="Items">
          <List>
          <Cell>Hello</Cell>
          <Cell>World</Cell>
          </List>
      </Group>
    </Panel>
  );
}

export default ViewPanel;
